import React from "react";
import Cards from "./Cards";
import "./App.css";
import Sdata from "./Sdata";

console.log(Sdata[0].title);

function ndata(val){
    return (
        <Cards
        imgsrc={Sdata[0].imgsrc}
        title={Sdata[0].title}
        sname={Sdata[0].sname}
        link={Sdata[0].link}
      />
    )
}

function App() {
  return (
    <>
      <h1 className="heading">List of Top 5 Netflix series</h1>
      
      Sdata.map(ndata)
    </>
  );
}

export default App;
